import { Component,OnInit,NgModule,VERSION } from '@angular/core';
import { FormsModule, NgForm } from '@angular/forms';
import { ProductsService } from '../layouts/card-builder/card-builder.service';
import { ProductModel } from '../layouts/card-builder/product.model';

@Component({
  selector: 'fm-add-product',
  templateUrl: './add-product.component.html',
  styleUrls: ['./add-product.component.css']
})
export class AddProductComponent implements OnInit {
constructor(private ps:ProductsService){

}
ngOnInit(): void {

}
addProduct(product:ProductModel){
  console.log("You Have Logged In");
  console.log(product);
  this.ps.addProducts(product);
}
}
<div class="container">
    <div class="row">
        <div class="col-8">
            <form #postForm="ngForm" {ngSubmit}="addProduct{postForm.value}">
                <div class="input-group">
                    <span class="input-group-text">Username</span>
                    <input type="text" class="form-control" ngModel name="username">
                </div>
                <div class="input-group">
                    <span class="input--group-text">Password</span>
                    <input type="text" class="form-control" ngModel name="password">
                </div>
                <button class="btn btn-dark" type="submit">
                    Login
                </button>
            </form>
        </div>
    </div>
</div>
